import React from 'react'
import './Contacts.css'

export default function Contacts() {
  return (
    <section className='contacts-wrapper'>
        <h1>My contacts</h1>
        <div className="contacts-content">
          <div className="contact-name">
            {/* <img src={} alt="photo" /> */}
            <h3></h3>
          </div>
        </div>
    </section>
  )
}
